import React, { useEffect, useState, useRef } from "react";
import { MapContainer, TileLayer, Marker, Popup, Polyline } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import L from "leaflet";
import { useNavigate, useLocation } from "react-router-dom";
import axios from "axios";

export default function RouteDetails() {
  const location = useLocation();
  const navigate = useNavigate();

  const filteredPois = location.state?.filteredPois || [];
  const startPoint = location.state?.startPoint || null;
  const transportMode = location.state?.transportMode || "driving-car";
  const userId = location.state?.userId || 1; // adjust as needed

  const [currentIndex, setCurrentIndex] = useState(0); // Current POI in tour
  const [likedPois, setLikedPois] = useState({}); // { poi_id: liked }
  const [currentPosition, setCurrentPosition] = useState(startPoint);

  const mapRef = useRef();

  const currentPoi = filteredPois[currentIndex];

  // -------------------- Like/Dislike --------------------
  const handleLike = async (poi_id, liked) => {
    try {
      await axios.post("http://127.0.0.1:5000/api/feedback", {
        user_id: userId,
        poi_id,
        liked
      });
      setLikedPois(prev => ({ ...prev, [poi_id]: liked }));
    } catch (err) {
      console.error("Failed to send feedback:", err);
    }
  };

  // -------------------- Next POI --------------------
  const handleNext = () => {
    if (currentIndex < filteredPois.length - 1) {
      setCurrentIndex(prev => prev + 1);
      setCurrentPosition(filteredPois[currentIndex + 1]);
    } else {
      alert("Tour finished!");
      navigate(-1); // or navigate to summary
    }
  };

  // -------------------- Map setup --------------------
  useEffect(() => {
    if (mapRef.current && currentPosition) {
      mapRef.current.setView(currentPosition, 15);
    }
  }, [currentPosition]);

  // -------------------- Render --------------------
  return (
    <div>
      {currentPoi ? (
        <div>
          <h2>POI {currentIndex + 1} of {filteredPois.length}</h2>
          <h3>{currentPoi.name}</h3>
          <p>{currentPoi.description}</p>

          {/* Like/Dislike Buttons */}
          <div style={{ marginBottom: "1rem" }}>
            <button
              onClick={() => handleLike(currentPoi.id, 1)}
              style={{ color: likedPois[currentPoi.id] === 1 ? "green" : "black" }}
            >
              üëç Like
            </button>

            <button
              onClick={() => handleLike(currentPoi.id, 0)}
              style={{ color: likedPois[currentPoi.id] === 0 ? "red" : "black" }}
            >
              üëé Dislike
            </button>

            <button onClick={handleNext}>Next POI</button>
          </div>

          {/* Feedback Status */}
          {likedPois[currentPoi.id] === 1 && <span>‚úÖ You liked this POI</span>}
          {likedPois[currentPoi.id] === 0 && <span>‚ùå You disliked this POI</span>}

          {/* Map */}
          <MapContainer
            center={currentPosition}
            zoom={15}
            style={{ height: "400px", width: "100%" }}
            whenCreated={mapInstance => (mapRef.current = mapInstance)}
          >
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution="&copy; OpenStreetMap contributors"
            />

            {/* Current POI Marker */}
            <Marker position={currentPosition}>
              <Popup>{currentPoi.name}</Popup>
            </Marker>

            {/* All POIs Polyline */}
            <Polyline positions={filteredPois.map(p => [p.lat, p.lng])} color="blue" />

            {/* Optional: markers for all POIs */}
            {filteredPois.map((poi, idx) => (
              <Marker key={poi.id} position={[poi.lat, poi.lng]}>
                <Popup>{poi.name}</Popup>
              </Marker>
            ))}
          </MapContainer>
        </div>
      ) : (
        <div>Loading tour...</div>
      )}
    </div>
  );
}
